import React from 'react'
import ClassItem from './ClassItem'

function ClassList({ classes }) {
  return (
    <div>
      {classes.map((cl, index) =>
        <ClassItem key={index} icon={cl.icon} name={cl.name}></ClassItem>)
      }
    </div>
  )
}

export default ClassList
